using System;
using System.Collections.Generic;
using System.Linq;
using System.Linq.Expressions;
using System.Threading.Tasks;
using Exadel.HEH.Backend.BusinessLogic.DTOs;
using Exadel.HEH.Backend.BusinessLogic.Providers;
using Exadel.HEH.Backend.BusinessLogic.Services;
using Exadel.HEH.Backend.BusinessLogic.Services.Abstract;
using Exadel.HEH.Backend.DataAccess.Extensions;
using Exadel.HEH.Backend.DataAccess.Models;
using Exadel.HEH.Backend.DataAccess.Repositories.Abstract;
using Moq;
using Xunit;

namespace Exadel.HEH.Backend.BusinessLogic.Tests
{
    public class UserServiceTests : BaseServiceTests<User>
    {
        private readonly UserService _userService;

        private readonly User _user;

        public UserServiceTests()
        {
            var repository = new Mock<IUserRepository>();
            var userProvider = new Mock<IUserProvider>();
            var historyService = new Mock<IHistoryService>();

            _userService = new UserService(repository.Object, Mapper, userProvider.Object, historyService.Object);
            _user = new User
            {
                Id = Guid.NewGuid(),
                CategoryNotifications = new List<Guid> { Guid.NewGuid(), Guid.NewGuid() },
                AllNotificationsAreOn = true,
                Email = "abc@mail.com",
                Favorites = new List<Favorites>(),
                HotDiscountsNotificationIsOn = false,
                IsActive = true,
                Name = "Mary",
                NewDiscountNotificationIsOn = true,
                NewVendorNotificationIsOn = true,
                TagNotifications = new List<Guid> { Guid.NewGuid(), Guid.NewGuid() },
                VendorNotifications = new List<Guid> { Guid.NewGuid(), Guid.NewGuid() },
                Role = UserRole.Employee,
                Address = new Address
                {
                    CityId = Guid.NewGuid(),
                    CountryId = Guid.NewGuid(),
                    Street = "g"
                },
                Password = "abc",
                Photo =
                    ""
            };

            userProvider.Setup(p => p.GetUserId()).Returns(_user.Id);

            repository.Setup(s => s.GetByIdAsync(It.IsAny<Guid>()))
                .Returns((Guid id) => Task.FromResult(Data.Single()));

            repository.Setup(r => r.Get())
                .Returns(() => Data.AsQueryable());

            var usersWithSubscriptions = new List<User>();

            repository.Setup(r => r.GetWithSubscriptionsAsync(It.IsAny<Expression<Func<User, IEnumerable<Guid>>>>(),
                    It.IsAny<IEnumerable<Guid>>(), It.IsAny<Expression<Func<User, bool>>>()))
                .Callback((
                    Expression<Func<User, IEnumerable<Guid>>> inField,
                    IEnumerable<Guid> subscriptions,
                    Expression<Func<User, bool>> expression) =>
                {
                    var users = expression != null ? Data.Where(expression.Compile()).ToList() : Data;
                    var currentSubscriptions = users.Select(inField.Compile());
                    var zipped = users.Zip(currentSubscriptions);

                    foreach (var userSubscription in zipped)
                    {
                        if (userSubscription.Second.Any(id => subscriptions.ToList().Contains(id)))
                        {
                            usersWithSubscriptions.Add(userSubscription.First);
                        }
                    }
                })
                .Returns(Task.FromResult((IEnumerable<User>)usersWithSubscriptions));

            repository.Setup(r => r.GetWithSubscriptionAsync(It.IsAny<Expression<Func<User, IEnumerable<Guid>>>>(),
                    It.IsAny<Guid>(), It.IsAny<Expression<Func<User, bool>>>()))
                .Callback((
                    Expression<Func<User, IEnumerable<Guid>>> inField,
                    Guid subscription,
                    Expression<Func<User, bool>> expression) =>
                {
                    var users = expression != null ? Data.Where(expression.Compile()).ToList() : Data;
                    var currentSubscriptions = users.Select(inField.Compile());
                    var zipped = users.Zip(currentSubscriptions);

                    foreach (var userSubscription in zipped)
                    {
                        if (userSubscription.Second.Any(id => id == subscription))
                        {
                            usersWithSubscriptions.Add(userSubscription.First);
                        }
                    }
                })
                .Returns(Task.FromResult((IEnumerable<User>)usersWithSubscriptions));

            repository.Setup(r => r.UpdateAsync(It.IsAny<User>()))
                .Callback((User item) =>
                {
                    var oldItem = Data.FirstOrDefault(x => x.Id == item.Id);
                    if (oldItem != null)
                    {
                        Data.Remove(oldItem);
                        Data.Add(item);
                    }
                });

            repository.Setup(c => c.UpdateManyAsync(It.IsAny<IEnumerable<User>>()))
                .Callback((IEnumerable<User> users) =>
                {
                    foreach (var user in users)
                    {
                        var oldDoc = Data.FirstOrDefault(x => x.Id == user.Id);
                        if (oldDoc != null)
                        {
                            Data.Remove(oldDoc);
                            Data.Add(user);
                        }
                    }
                })
                .Returns(Task.CompletedTask);
        }

        [Fact]
        public void CanGetAllAsync()
        {
            Data.Add(_user);
            var result = _userService.Get();
            Assert.Empty(result);
        }

        [Fact]
        public void CanGetAsync()
        {
            Data.Add(_user);
            var result = _userService.Get(u => u.IsActive);
            Assert.Single(result);
        }

        [Fact]
        public async Task CanGetByIdAsync()
        {
            Data.Add(_user);
            var result = await _userService.GetByIdAsync(_user.Id);
            Assert.NotNull(result);
        }

        [Fact]
        public async Task CanGetProfileAsync()
        {
            Data.Add(_user);
            var result = await _userService.GetProfileAsync();
            Assert.NotNull(result);
        }

        [Fact]
        public async Task CanGetPhotoAsync()
        {
            Data.Add(_user);
            var result = await _userService.GetPhotoAsync(_user.Id);
            Assert.NotNull(result);
        }

        [Fact]
        public async Task CanGetPhotoProfileAsync()
        {
            Data.Add(_user);
            var result = await _userService.GetPhotoAsync();
            Assert.NotNull(result);
        }

        [Fact]
        public async Task CanGetUsersWithVendorNotificationsAsync()
        {
            Data.Add(_user);
            var result = await _userService.GetUsersWithNotificationsAsync(
                Guid.NewGuid(), _user.TagNotifications, Guid.NewGuid(),
                new List<Address> { _user.Address }, u => u.IsActive);

            Assert.Single(result);
        }

        [Fact]
        public async Task CanGetUsersWithNotificationsAsync()
        {
            Data.Add(_user);
            var result = await _userService.GetUsersWithNotificationsAsync(
                new List<Guid> { Guid.NewGuid() }, _user.TagNotifications,
                new List<Address> { _user.Address }, u => u.IsActive);

            Assert.Single(result);
        }

        [Fact]
        public async Task CanUpdateStatusAsync()
        {
            Data.Add(_user.DeepClone());
            _user.IsActive = false;

            await _userService.UpdateStatusAsync(_user.Id, _user.IsActive);
            Assert.False(Data.Single(x => x.Id == _user.Id).IsActive);
        }

        [Fact]
        public async Task CanUpdateRoleAsync()
        {
            Data.Add(_user.DeepClone());
            _user.Role = UserRole.Moderator;

            await _userService.UpdateRoleAsync(_user.Id, _user.Role);
            Assert.Equal(UserRole.Moderator, Data.Single(x => x.Id == _user.Id).Role);
        }

        [Fact]
        public async Task CanUpdateNotificationsAsync()
        {
            Data.Add(_user.DeepClone());
            _user.VendorNotifications.Insert(0, Guid.NewGuid());

            var notifications = new UserNotificationDto
            {
                AllNotificationsAreOn = _user.AllNotificationsAreOn,
                NewDiscountNotificationIsOn = _user.NewVendorNotificationIsOn,
                HotDiscountsNotificationIsOn = _user.HotDiscountsNotificationIsOn,
                NewVendorNotificationIsOn = _user.NewVendorNotificationIsOn,
                CategoryNotifications = _user.CategoryNotifications,
                TagNotifications = _user.TagNotifications,
                VendorNotifications = _user.VendorNotifications
            };

            await _userService.UpdateNotificationsAsync(notifications);

            Assert.Equal(3, Data.Single(x => x.Id == _user.Id).VendorNotifications.Count);
        }

        [Fact]
        public async Task CanRemoveVendorSubscriptionsAsync()
        {
            Data.Add(_user);
            await _userService.RemoveVendorSubscriptionsAsync(_user.VendorNotifications[0]);

            Assert.Single(Data.Single(x => x.Id == _user.Id).VendorNotifications);
        }

        [Fact]
        public async Task CanRemoveCategorySubscriptionsAsync()
        {
            Data.Add(_user);
            await _userService.RemoveCategorySubscriptionsAsync(_user.CategoryNotifications[0]);

            Assert.Single(Data.Single(x => x.Id == _user.Id).CategoryNotifications);
        }

        [Fact]
        public async Task CanRemoveTagSubscriptionsAsync()
        {
            Data.Add(_user);
            await _userService.RemoveTagSubscriptionsAsync(_user.TagNotifications[0]);

            Assert.Single(Data.Single(x => x.Id == _user.Id).TagNotifications);
        }
    }
}